import React from "react";
import "./Shop.css";
import pic from "./1.png"

function Shop() {
  return (
    <div className="shop">
      <h1 className="">Shop</h1>
      <div className="shop-img">
        <img src={pic} alt="one" />
        <img src={pic} alt="" />
        <img src={pic} alt="" />
        <img src={pic} alt="" />
        <img src={pic} alt="" />
      </div>
    </div>
  );
}

export default Shop;
